import axios from "axios";

const BACKEND_URL =
  "https://react-native-expense-tra-ad38d-default-rtdb.firebaseio.com/expenses.json";

export function storeExpense(expenseData) {
  axios.post(
    "https://react-native-expense-tra-ad38d-default-rtdb.firebaseio.com/expenses.json",
    expenseData
  );
}

export function fetchExpenses() {
  axios.get("");
}
